import './App.css';
import { Container, createTheme, ThemeProvider, makeStyles } from "@material-ui/core";
import { BrowserRouter, Navigate, Route, Routes } from "react-router-dom";
import { SnackbarProvider } from 'notistack';
import LoginView from './views/login';
import HomeView from './views/home/index.jsx';

const theme = createTheme({});

const useStyles = makeStyles((theme) => ({
  root: {
    height: "100vh",
    backgroundColor: theme.palette.grey[500]
  }
}));



function App() {
  const classes = useStyles();

  return (
    <ThemeProvider theme={theme}>
      <SnackbarProvider maxSnack={3}>
        <BrowserRouter>
          <Container maxWidth={false} className={classes.root} disableGutters>
            <Routes>
              <Route path="*" element={<p>Path not resolved</p>} />
              <Route path="/login" element={<LoginView />} />
              <Route path="/home" element={<HomeView />} />
              <Route path="/token" element={<Navigate to="/login" />} />
            </Routes>
          </Container>
        </BrowserRouter>
      </SnackbarProvider>
    </ThemeProvider>
  );
}

export default App;
